function changeUnit(){let e=localStorage.getItem("uniType")??"SI",t=localStorage.getItem("temperature")??23.4;"I"==e?(localStorage.setItem("uniType","SI"),t=cdegre(t)):(localStorage.setItem("uniType","I"),t=fdegre(t)),displayTemp(t)}function displayTemp(e){var t=Math.floor(e),n=Math.floor(100*(e-t));n=add0(n),$("#temp").html(t??"N/A"),$("#point").html("."+n??"")}function fdegre(e){return $("#unitChangeBtn").html("Change to ºC"),$("#tempUnit").html("ºF"),e=1.8*e+32}function cdegre(e){return $("#unitChangeBtn").html("Change to ºF"),$("#tempUnit").html("ºC"),e}function generateCSV(e){let t="Time,Temperature\n";return e.forEach((e=>{let n=e.val();t+=changeClockFormat(n.timestamp)+","+n.temp+"\n"})),t}function changeClockFormat(e){let t=new Date(1e3*parseInt(e));return t.getFullYear()+"-"+add0(t.getMonth())+"-"+add0(t.getDate())+" "+add0(t.getHours())+":"+add0(t.getMinutes())+":"+add0(t.getSeconds())}function add0(e){return e<10?"0"+e:e}